import React from "react";
import {Container, Row, Col} from "react-bootstrap";

export const MessagePage = () => {
    return(
        <div className='bg-dark h-100 w-100'>
            <Container>
                <Row md='9' className='d-flex flex-column-reverse'>
                    <Col className='text-light'>TEST1</Col>
                    <Col className='text-light'>TEST2</Col>
                    <Col className='text-light'>TEST3</Col>
                    <Col className='text-light'>TEST4</Col>
                    <Col className='text-light'>TEST5</Col>

                </Row>
            </Container>
        </div>
    )
}
